ed in September 2003 and now up on }{\\field\\fldedit{\\*\\fldinst {\\f1\\fs20\\insrsid6517785\\charrsid6517785  HYPERLINK \"http://peteryared.blogspot.com/\" }{\\f1\\fs20\\insrsid2367002\\charrsid6427004 \r\n{\\*\\datafield 00d0c9ea79f9bace118c8200aa004ba90b0200000003000000e0c9ea79f9bace118c8200aa004ba90b4000000068007400740070003a002f002f0070006500740065007200790061007200650064002e0062006c006f006700730070006f0074002e0063006f006d002f00000000a3}}}{\\fldrslt {\r\n\\cs17\\f1\\fs20\\ul\\cf1\\insrsid6517785\\charrsid6517785 his new Blogspot weblog}}}{\\f1\\fs20\\insrsid6517785\\charrsid6517785 , discuss the evolution of computing to arrive at XML we\r\nb services, and the implication of where we are now for the role of application servers and Java. First, }{\\field\\fldedit{\\*\\fldinst {\\cs18\\i\\f1\\fs20\\insrsid6517785\\charrsid6517785 \r\n HYPERLINK \"http://peteryared.blogspot.com/2003/09/application-servers-2004-big-muffin-in.html\" }{\\i\\f1\\fs20\\insrsid2367002\\charrsid6427004 {\\*\\datafield \r\n00d0c9ea79f9bace118c8200aa004ba90b0200000003000000e0c9ea79f9bace118c8200aa004ba90ba600000068007400740070003a002f002f0070006500740065007200790061007200650064002e0062006c006f006700730070006f0074002e0063006f006d002f0032003000300033002f00300039002f0061007000\r\n70006c00690063006100740069006f006e002d0073006500720076006500720073002d0032003000300034002d006200690067002d006d0075006600660069006e002d0069006e002e00680074006d006c000000008e}}}{\\fldrslt {\\cs17\\i\\f1\\fs20\\ul\\cf1\\insrsid6517785\\charrsid6517785 \r\nApplication Servers 2004: A Big Muffin in a Donut World}}}{\\f1\\fs20\\insrsid6517785\\charrsid6517785 , which comes to the conclusion we don\'t need them: \r\n\\par We must remember that the original point of the application server was to solve the big corporate impedance mismatch and arbitrate connections to overwhelmed back-end resources. Today: \r\n\\par {\\listtext\\pard\\plain\\f3\\fs20\\insrsid6517785\\charrsid6517785 \\loch\\af3\\dbch\\af0\\hich\\f3 \\\'b7\\tab}}\\pard \\ql \\fi-360\\li720\\ri0\\sb100\\sa100\\sbauto1\\saauto1\\widctlpar\\jclisttab\\tx720\\aspalpha\\aspnum\\faauto\\ls1\\adjustright\\rin0\\lin720\\itap0\\pararsid6517785 {\r\n\\f1\\fs20\\insrsid6517785\\charrsid6517785 There is no impedance mismatch, everything talks SOAP/HTTP \r\n\\par {\\listtext\\pard\\plain\\f3\\fs20\\insrsid6517785\\charrsid6517785 \\loch\\af3\\dbch\\af0\\hich\\f3 \\\'b7\\tab}Back-end resources can now all support numerous transient connections \r\n\\par }\\pard \\ql \\li0\\ri0\\sa192\\widctlpar\\aspalpha\\aspnum\\faauto\\adjustright\\rin0\\lin0\\itap0\\pararsid6517785 {\\f1\\fs20\\insrsid6517785\\charrsid6517785 \r\n... So where is the application server of the future? It is a big text pump that is embedded in the various endpoints of an enterprise. There is nothing in the middle. \r\n\\par Peter\'s }{\\field\\fldedit{\\*\\fldinst {\\f1\\fs20\\insrsid6517785\\charrsid6517785  HYPERLINK \"http://home.pacbell.net/pyared/minires.html\" }{\\f1\\fs20\\insrsid2367002\\charrsid6427004 {\\*\\datafield \r\n00d0c9ea79f9bace118c8200aa004ba90b0200000003000000e0c9ea79f9bace118c8200aa004ba90b5800000068007400740070003a002f002f0068006f006d0065002e00700061006300620065006c006c002e006e00650074002f007000790061007200650064002f006d0069006e0069007200650073002e0068007400\r\n6d006c0000000058}}}{\\fldrslt {\\cs17\\f1\\fs20\\ul\\cf1\\insrsid6517785\\charrsid6517785 credentials}}}{\\f1\\fs20\\insrsid6517785\\charrsid6517785 \r\n, by the way, include being the former CTO of NetDynamics, the application server vendor acquired in 1998 by Sun. Astute readers wi\r\nll note that the one thing missing from the above scenario is some kind of fabric or bus that connects up all the various endpoints, which links back rather neatly to what I was saying in }{\\field\\fldedit{\\*\\fldinst {\r\n\\f1\\fs20\\insrsid6517785\\charrsid6517785  HYPERLINK \"http://www.looselycoupled.com/blog/lc00aa00073.html\" }{\\f1\\fs20\\insrsid2367002\\charrsid6427004 {\\*\\datafield \r\n00d0c9ea79f9bace118c8200aa004ba90b0200000003000000e0c9ea79f9bace118c8200aa004ba90b6800000068007400740070003a002f002f007700770077002e006c006f006f00730065006c00790063006f00750070006c00650064002e0063006f006d002f0062006c006f0067002f006c0063003000300061006100\r\n300030003000370033002e00680074006d006c00000000a4}}}{\\fldrslt {\\cs17\\f1\\fs20\\ul\\cf1\\insrsid6517785\\charrsid6517785 my previous post}}}{\\f1\\fs20\\insrsid6517785\\charrsid6517785 \r\n about ESB. But of course Peter\'s new company also has a proposed solution of its own, which I\'ll come to in a moment. First, let\'s move on to his other article, }{\\field\\fldedit{\\*\\fldinst {\\cs18\\i\\f1\\fs20\\insrsid6517785\\charrsid6517785 \r\n HYPERLINK \"http://peteryared.blogspot.com/2003/09/next-language.html\" }{\\i\\f1\\fs20\\insrsid2367002\\charrsid6427004 {\\*\\datafield \r\n00d0c9ea79f9bace118c8200aa004ba90b0200000003000000e0c9ea79f9bace118c8200aa004ba90b7400000068007400740070003a002f002f0070006500740065007200790061007200650064002e0062006c006f006700730070006f0074002e0063006f006d002f0032003000300033002f00300039002f006e006500\r\n780074002d006c0061006e00670075006100670065002e00680074006d006c0000000098}}}{\\fldrslt {\\cs17\\i\\f1\\fs20\\ul\\cf1\\insrsid6517785\\charrsid6517785 The Next Language}}}{\\f1\\fs20\\insrsid6517785\\charrsid6517785 \r\n, which explains why Java has become a big waste of time and resources in today\'s world of XML web services: \r\n\\par So let\'s look at the requirements for today\'s corporate applications ... Given these requirements, Java does not fare very well. Appa\r\nrently what is needed is a language/environment that is loosely typed in order to encapsulate XML well and that can efficiently process text. It should be very well suited for specifying control flow. And it should be a thin veneer over the operating syst\r\nem.\r\n\\par Most Linux distribution in fact bundle three such languages, PHP, Python, and Perl ... they have the necessary ingredients to meet the requirements of the next corporate computing phase of \"text pump\" applications. \r\n\\par Let\'s turn now to ActiveGrid, quoting from the company\'s }{\\field\\fldedit{\\*\\fldinst {\\f1\\fs20\\insrsid6517785\\charrsid6517785  HYPERLINK \"http://www.activegrid.com/news/pressrelease-111704.php\" }{\\f1\\fs20\\insrsid2367002\\charrsid6427004 {\\*\\datafield \r\n00d0c9ea79f9bace118c8200aa004ba90b0200000003000000e0c9ea79f9bace118c8200aa004ba90b6e00000068007400740070003a002f002f007700770077002e0061006300740069007600650067007200690064002e0063006f006d002f006e006500770073002f0070007200650073007300720065006c0065006100\r\n730065002d003100310031003700300034002e0070006800700000000017}}}{\\fldrslt {\\cs17\\f1\\fs20\\ul\\cf1\\insrsid6517785\\charrsid6517785 launch press release}}}{\\f1\\fs20\\insrsid6517785\\charrsid6517785 , issued yesterday: \r\n\\par ActiveGrid represents a fundamental shift from traditional data center architectures, such as J2EE, by enabling transactiona\r\nl applications to be horizontally scaled across a transaction grid of low-cost computers, as contrasted to the traditional approach of scaling vertically on a small cluster of expensive multi-processor machines that must continually connect to backend sys\r\ntems. \r\n\\par ... The value of transaction grids for mainstream business applications has been proven by a few forward-thinking companies like Google and Amazon whose experts have hand-crafted grids for in-house use. Until now, the benefits of grid computing have \r\nremained elusive for all but a few such companies. The ActiveGrid Grid Application Server software platform will enable corporate developers to easily create, integrate, deploy, and scale transaction grids within their own organizations ... \r\n\\par \"J2EE and .NET\r\n applications were never designed with grids in mind. Just as you would never construct a modern building on top of debris from an old building, you should not rely on the existing technology base as a foundation for developing the next generation of ente\r\nrprise computing. ActiveGrid\'s technology is a critical foundation for enabling applications to fully utilize the power of the transaction grid,\" said Jean-Louis Gass\\\'e9e, general partner at Allegis Capital. \r\n\\par Of course, calling its platform an application ser\r\nver is something of a marketing ploy since, as Peter has explained, an application server is the last thing you need. What ActiveGrid is really providing is a highly tuned \"text pump\" to occupy the fabric/bus space in a transaction-intensive enterprise da\r\nt\r\na center. It\'s an interesting proposition, and one that highlights the immensely disruptive potential of XML standards-based services architectures. Some combination of XML web services grid/mesh/fabric/bus, once we all get through the experimentation sta\r\nge and begin to agree on what works best, is going to obsolete every previous generation of integration middleware \\emdash and that includes J2EE application servers. \r\n\\par }\\pard \\ql \\li0\\ri0\\nowidctlpar\\tqr\\tx3500\\tqr\\tx7000\\tqr\\tx8900\\faauto\\rin0\\lin0\\itap0 {\\f1\\fs20\\insrsid6517785\\charrsid6517785 \r\n\\par }{\\f1\\fs20\\insrsid71023\\charrsid6517785 Kind regards,}{\\f1\\fs20\\insrsid2494917\\charrsid6517785 \r\n\\par }{\\lang1024\\langfe1024\\noproof\\insrsid9126118 {\\shp{\\*\\shpinst\\shpleft-436\\shptop130\\shpright1604\\shpbottom1570\\shpfhdr0\\shpbxcolumn\\shpbxignore\\shpbypara\\shpbyignore\\shpwr3\\shpwrk0\\shpfblwtxt1\\shpz0\\shplid1027\r\n{\\sp{\\sn shapeType}{\\sv 75}}{\\sp{\\sn fFlipH}{\\sv 0}}{\\sp{\\sn fFlipV}{\\sv 0}}{\\sp{\\sn pib}{\\sv {\\pict\\picscalex68\\picscaley43\\piccropl0\\piccropr0\\piccropt0\\piccropb0\r\n\\picw5292\\pich5953\\picwgoal3000\\pichgoal3375\\pngblip\\bliptag1812387828{\\*\\blipuid 6c06d7f4d86c96c23e901369230de968}89504e470d0a1a0a0000000d49484452000000c8000000e10100000000a580c7cd00000002624b47440001dd8a13a40000000c636d50504a436d703037313200\r\n0000074f6db7a5000001f94944415458c3edd8c16a83401006